//import './changeClass.css';
import React from 'react';
import {ArticleDetailPage, ArticleDetailAuthor, ArticleDetailTitle, ArticleDetailText, ArticleDetailSavedBtn, ArticleDetailComment}  from './components/ArticleDetailStyle.js';
import { Routes ,Route,Link } from 'react-router-dom';
import {useEffect,useState} from "react";

const RentArticle=()=> {

    const [data, setData] = useState(null);

    function Articleinfo({ author, text }) {
        return (
          <ArticleContainer>
            <ArticleText>
                <ArticleAuthor>{author}</ArticleAuthor>
                <ArticleBody>{text}</ArticleBody>
            </ArticleText>
          </ArticleContainer>
        );
      }


    function RentArticle() {


        useEffect(() => {
            if (!data) {
              fetch('/rent_full_post')
                .then(response => response.json())
                .then(data => setData(data))
                .catch(error => {
                  console.error('Error:', error);
                });
            }
          }, [data]); // 添加依賴項data
    
          if (!data) {
            return <div>Loading...</div>;
          }

      return (
        <Page>
            <Pagebg>
                <Title>租屋板</Title>
                <Link to='/postArticle'>
                  <PostArticleBtn>我要發文</PostArticleBtn>
                </Link>
                <ArticleList>
                    <Articleinfo author={"evelyn"} text={"I love you"}></Articleinfo>
                    <Articleinfo author={"vvvvvvvv"} text={"I love you soooo such"}>hiiiii</Articleinfo>
                </ArticleList>
            </Pagebg>
        </Page>
      );
    }

    return (
           
                <Routes>
                    <Route path="/" element={<RentArticle />} />
                </Routes>
             
    );
}

export default RentArticle;
